import React from "react";

function App() {
    let [tabs, setTabs] = React.useState([])
    let [buttons, setButtons] = React.useState([])

    function ButtonsList(props) {
        let buttons = ['Тайланд', 'Вьетнам', 'ОАЭ', 'Китай', 'Испания', 'Франция']
        return (
            buttons.map((button) => {
                return (
                    <span className='button'>{button}</span>
                )})
        )
    }

  return (
    <div>
      <h2>Горящие туры</h2>
        <p className='description'>Безусловно, сплоченность команды профессионалов говорит о возможностях</p>
    </div>
  )
}

export default App;
